description:
Tom, a paparazzi, is assigned to get pictures of Sophie, who is vacationing in Croatia. He won't take his girlfriend Maggie, and she decides to get even. In Croatia, Tom locates Sophie, but Maggie and a friend steal his pictures. Wounded, Tom is looked after by Sophie and her girls. Meanwhile, Maggie gets involved in double penetrations with Sophie's bodyguards, and Tom falls in love with Sophie. Shot on locations in Croatia and Bosnia Herzegovina, amidst breathtaking waterfalls, islands and beaches.

